script: |
  super -f text -I q12709.spq | sort > q12709.out

inputs:
  - name: q12709.spq
    data: |
      SELECT col2 + - 85 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NOT ( + col0 * 85 + CAST ( NULL AS INTEGER ) * col2 ) NOT BETWEEN + col1 + col0 AND ( - 80 ) );
  - name: tab2

outputs:
  - name: q12709.out
    data: |
